import React from 'react';
import Header from '../Header/Header';
import Footer from '../Footer/Footer';

const MainLayout = ({ children }) => {
  return (
    <div className="container">
      <Header />
      <div className="content">
      <main>{children}</main>
      </div>
      <Footer />
    </div>
  );
};

export default MainLayout;
